    </Stack.Navigator>
  );
}

export default function App() {
  return (
    <Context.Provider>
      <NavigationContainer>
        <Tab.Navigator>
          <Tab.Screen name="Courses" component={CoursesStack} />
          <Tab.Screen name="About" component={AboutScreen} />
        </Tab.Navigator>
      </NavigationContainer>
    </Context.Provider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
